import ProrideImg2 from '../static/images/proride-kids-2.png'

const homePageBanners = [
    {
        title: 'Test',
        classes: 'green-gradient',
        fullScreen: true,
        buttonText: 'test button',
        buttonLink: '/services',
        imageDescription: 'sample description',
        imageSrc: ProrideImg2
    }
]

export default homePageBanners;
